/**
 * Apple platform detection. Return true if platform is MacOS.
 *
 * NOTE: This module is actually included on `@wordpress/keycodes`'s `./platform.js` but it isn't
 * being exported outside the package so it can not be imported via `@wordpress/keycodes`. Thus,
 * it needs to be included here.
 *
 * @param {Window} _window Window object by default; used for DI testing.
 *
 * @returns {boolean} True if MacOS; false otherwise.
 */
export declare function isAppleOS(_window?: Window): boolean;
